import React from "react";

function About() {
	return (
		<main>
			<h2>About Me</h2>
			<div>
				<p>Navy veteran with 3 years of experience in instruction and acquisition of the Russian language, computer systems and networking. I have excellent leadership and motivational skills which I look forward to using to better improve the success of myself and colleagues.

As a US Navy veteran, I have developed strong communication and teamwork skills. I work well in fast paced and high stress environments. I look forward to growing my skills in the field of web development. 
</p>
			</div>
		</main>
	);
}

export default About;
